import React from 'react';
import { Tabs, TabList, Tab, TabPanel } from 'react-tabs';

const MenuTabs = () => (
    <Tabs>
        <TabList>
            <Tab>Projects</Tab>
            <Tab>Skills</Tab>
            <Tab>Certification</Tab>
        </TabList>
        <TabPanel>
            djfldsjfkld
        </TabPanel>
    </Tabs>
);

export default MenuTabs;
